import React from "react";
import { Link } from "react-router-dom";

import { projectData } from "./data";
import projectimg1 from "../img/project1.png";
import projectimg2 from "../img/project2.png";
import projectimg3 from "../img/project3.png";
const projectImage = [projectimg1, projectimg2, projectimg3];
const projectbg = ["#212125", "#e5e3db", "#212125"]

const Project = () => {
  return (
    <section id="project" className="item">
      <div className="project_wrap">
        {projectData.map((project, i) => (
          <div key={i} className="project" data-bgcolor={projectbg[i]}>
            <div className="project_url_wrap">
              <Link to={project.url} className="project_url"  target="_blank" rel="noopener noreferrer">
                <img src={projectImage[i]} alt={project.title} />
                <p className="project_logo">{project.logo}</p>
              </Link>
            </div>
            <div className="project_info">
              <span>{project.title}</span>
              <span>{project.type}</span>
              <span>{project.info}</span>
            </div>
          </div>
        ))}

      </div>
    </section>
  );
};

export default Project;
